INSERT INTO `sd_template` VALUES (124, 'infographic_3', 13, '<mxGraphModel dx=\"195\" dy=\"825\" grid=\"1\" gridSize=\"10\" guides=\"1\" tooltips=\"1\" connect=\"1\" arrows=\"1\" fold=\"1\" page=\"1\" pageScale=\"1\" pageWidth=\"1169\" pageHeight=\"827\" background=\"#ffffff\" math=\"0\" shadow=\"0\">\n  <root>\n    <mxCell id=\"0\"/>\n    <mxCell id=\"1\" parent=\"0\"/>\n    <mxCell id=\"934\" value=\"\" style=\"rounded=0;whiteSpace=wrap;html=1;fillColor=#444;strokeColor=#444;strokeWidth=2;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1259\" y=\"2234\" width=\"1010\" height=\"330\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"935\" value=\"\" style=\"rounded=0;whiteSpace=wrap;html=1;fillColor=#ffffff;strokeColor=#FFFFFF;fontColor=#000000;strokeWidth=2;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1259\" y=\"54\" width=\"1010\" height=\"470\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"936\" value=\"\" style=\"rounded=0;whiteSpace=wrap;html=1;strokeColor=#eee;fillColor=#EEE;strokeWidth=2;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1259\" y=\"524\" width=\"1010\" height=\"590\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"937\" value=\"\" style=\"rounded=0;whiteSpace=wrap;html=1;strokeColor=#F08705;fillColor=#F08705;strokeWidth=2;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1259\" y=\"1115\" width=\"1010\" height=\"442\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"938\" value=\"\" style=\"rounded=0;whiteSpace=wrap;html=1;fillColor=#333;strokeColor=#333;strokeWidth=2;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1259\" y=\"1554\" width=\"1010\" height=\"680\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"939\" value=\"\" style=\"rounded=0;whiteSpace=wrap;html=1;fillColor=#eee;strokeColor=#eee;strokeWidth=2;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1259\" y=\"2564\" width=\"1010\" height=\"750\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"940\" value=\"\" style=\"shape=image;verticalLabelPosition=bottom;labelBackgroundColor=#ffffff;verticalAlign=top;aspect=fixed;imageAspect=0;image=data:image/svg+xml,;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1578\" y=\"1711\" width=\"274\" height=\"274\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"941\" value=\"\" style=\"shape=image;verticalLabelPosition=bottom;labelBackgroundColor=#ffffff;verticalAlign=top;aspect=fixed;imageAspect=0;image=data:image/svg+xml,;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1260\" y=\"1702\" width=\"280\" height=\"280\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"942\" value=\"\" style=\"shape=image;verticalLabelPosition=bottom;labelBackgroundColor=#ffffff;verticalAlign=top;aspect=fixed;imageAspect=0;image=data:image/svg+xml,;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1315\" y=\"2267\" width=\"272\" height=\"272\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"943\" value=\"\" style=\"shape=image;verticalLabelPosition=bottom;labelBackgroundColor=#ffffff;verticalAlign=top;aspect=fixed;imageAspect=0;image=data:image/svg+xml,;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1316\" y=\"2717\" width=\"892\" height=\"274\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"944\" value=\"\" style=\"shape=image;verticalLabelPosition=bottom;labelBackgroundColor=#ffffff;verticalAlign=top;aspect=fixed;imageAspect=0;image=data:image/svg+xml,;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1238\" y=\"480\" width=\"292\" height=\"292\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"945\" value=\"\" style=\"shape=image;verticalLabelPosition=bottom;labelBackgroundColor=#ffffff;verticalAlign=top;aspect=fixed;imageAspect=0;image=data:image/svg+xml,;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1551\" y=\"495\" width=\"276\" height=\"276\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"946\" value=\"\" style=\"shape=image;verticalLabelPosition=bottom;labelBackgroundColor=#ffffff;verticalAlign=top;aspect=fixed;imageAspect=0;image=data:image/svg+xml,;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1851\" y=\"488\" width=\"280\" height=\"280\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"947\" value=\"\" style=\"shape=image;verticalLabelPosition=bottom;labelBackgroundColor=#ffffff;verticalAlign=top;aspect=fixed;imageAspect=0;image=data:image/svg+xml,;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1316\" y=\"1151\" width=\"276\" height=\"276\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"948\" value=\"&lt;p style=&quot;line-height: 160%&quot;&gt;&lt;font style=&quot;font-size: 15px ; line-height: 170%&quot; color=&quot;#444444&quot;&gt;The world is becoming more visual&lt;br&gt;and time poor. We are bombarded&lt;br&gt;with an ever increasing mountain&lt;br&gt;of information, and we are pressu-&lt;br&gt;red to spend less attention and&lt;br&gt;time on taking everything in. We&lt;br&gt;skim and scan our way through&lt;br&gt;documentation, missing a lot of&lt;br&gt;detail in the process.&lt;/font&gt;&lt;/p&gt;\" style=\"text;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=15;fontFamily=Verdana;html=1;fontColor=#444444;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1324\" y=\"779\" width=\"280\" height=\"260\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"949\" value=\"&lt;font color=&quot;#444444&quot; style=&quot;font-size: 25px ; line-height: 130%&quot;&gt;WE DON&#39;T HAVE&lt;br&gt;TIME TO READ&lt;/font&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=14;fontFamily=Verdana;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1324\" y=\"710\" width=\"220\" height=\"70\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"950\" value=\"&lt;p style=&quot;line-height: 170%&quot;&gt;&lt;font color=&quot;#444444&quot;&gt;Approximately 60% of us think&lt;br&gt;visually&amp;nbsp;- we see a series of pictu-&lt;br&gt;res instead of words in our minds.&lt;br&gt;The human brain perceives diffe-&lt;br&gt;rences between images more&lt;br&gt;quickly, and ensures&amp;nbsp;we&lt;br&gt;remember graphics more easily&lt;br&gt;and thoroughly than written text.&lt;br&gt;&lt;/font&gt;&lt;br&gt;&lt;/p&gt;\" style=\"text;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=15;fontFamily=Verdana;html=1;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1634\" y=\"780\" width=\"270\" height=\"260\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"951\" value=\"&lt;font style=&quot;font-size: 25px&quot;&gt;MOST PEOPLE&amp;nbsp;&lt;br&gt;LEARN VISUALLY&lt;/font&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=14;fontFamily=Verdana;fontColor=#444444;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1634\" y=\"713\" width=\"230\" height=\"40\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"952\" value=\"&lt;font style=&quot;font-size: 25px&quot;&gt;VISUAL IQ IS&lt;br&gt;INCREASING&lt;/font&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=14;fontFamily=Verdana;fontColor=#444444;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1942\" y=\"712\" width=\"180\" height=\"40\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"953\" value=\"&lt;p style=&quot;line-height: 170%&quot;&gt;&lt;font color=&quot;#444444&quot;&gt;Our visual IQ is increasing&amp;nbsp;more&lt;br&gt;rapidly than our general IQ - we&lt;br&gt;are getting better at recognizing&lt;br&gt;patterns. It is unclear though&lt;br&gt;whether this is the driving force&lt;br&gt;behind the rising popularity of&lt;br&gt;diagrams, or as a result of being&lt;br&gt;increasingly surrounded by&lt;br&gt;diagrams. &amp;nbsp;&lt;/font&gt;&lt;/p&gt;\" style=\"text;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=15;fontFamily=Verdana;html=1;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1942\" y=\"779\" width=\"260\" height=\"260\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"954\" value=\"&lt;font color=&quot;#fce7cd&quot;&gt;&lt;span style=&quot;font-size: 25px ; line-height: 30px&quot;&gt;DIAGRAMS CONVEY COMPLEX&lt;/span&gt;&lt;/font&gt;&lt;div&gt;&lt;font color=&quot;#fce7cd&quot;&gt;&lt;span style=&quot;font-size: 25px ; line-height: 30px&quot;&gt;INFORMATION&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=14;fontFamily=Verdana;fontColor=#444444;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1634\" y=\"1170\" width=\"400\" height=\"60\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"955\" value=\"&lt;p style=&quot;line-height: 170%&quot;&gt;&lt;font color=&quot;#fce7cd&quot;&gt;Imagine trying to convey an organization鈥檚 management hierarchy with pure&lt;br&gt;text, or describe a complex business process with many decision points&lt;br&gt;without any supporting graphics. Even trying to explain a circuit board layout&lt;br&gt;or a simple room layout using only text sounds like a nightmare.&lt;br&gt;&lt;/font&gt;&lt;br&gt;&lt;/p&gt;\" style=\"text;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=15;fontFamily=Verdana;html=1;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1634\" y=\"1239\" width=\"600\" height=\"160\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"956\" value=\"&lt;p style=&quot;line-height: 170%&quot;&gt;&lt;font color=&quot;#fce7cd&quot;&gt;Businesses are quickly becoming technically,&amp;nbsp;procedurally, and organizational-&lt;br&gt;ly more complex.&amp;nbsp;Visualization is a great tool for communicating dense and&lt;br&gt;complex information quickly.&lt;/font&gt;&lt;br&gt;&lt;/p&gt;\" style=\"text;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=15;fontFamily=Verdana;html=1;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1634\" y=\"1363\" width=\"610\" height=\"110\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"957\" value=\"&lt;font style=&quot;font-size: 95px&quot;&gt;&lt;b style=&quot;background-color: rgb(255 , 255 , 255)&quot;&gt;WHY DIAGRAMS&lt;/b&gt;&lt;/font&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=14;fontFamily=Verdana;fontColor=#444444;labelBackgroundColor=none;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1324\" y=\"257\" width=\"890\" height=\"50\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"958\" value=\"ARE IMPORTANT\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=60;fontFamily=Verdana;fontColor=#444444;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1324\" y=\"385\" width=\"130\" height=\"20\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"959\" value=\"&lt;p style=&quot;line-height: 170%&quot;&gt;&lt;br&gt;&lt;/p&gt;\" style=\"text;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=15;fontFamily=Verdana;html=1;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1454\" y=\"1664\" width=\"20\" height=\"60\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"960\" value=\"&lt;p style=&quot;line-height: 170%&quot;&gt;Present training or on-boarding&lt;br&gt;material visually, in additional to&lt;br&gt;traditional reports and presenta-&lt;br&gt;tions. New employees will be&lt;br&gt;ready to be a productive part of&lt;br&gt;their teams more quickly, and&lt;br&gt;training courses will be more&lt;br&gt;successful.&lt;/p&gt;\" style=\"text;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=15;fontFamily=Verdana;fontColor=#BBBBBB;html=1;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1324\" y=\"1988\" width=\"260\" height=\"230\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"961\" value=\"&lt;p style=&quot;line-height: 170%&quot;&gt;Use your employees&#39; improved&lt;br&gt;spatial reasoning to solve a wide&lt;br&gt;range of problems and to design&lt;br&gt;better processes, structures, and&lt;br&gt;workflows to improve your com-&lt;br&gt;pany&#39;s productivity.&lt;br&gt;&lt;/p&gt;\" style=\"text;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=15;fontFamily=Verdana;fontColor=#BBBBBB;html=1;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1635\" y=\"1988\" width=\"270\" height=\"180\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"962\" value=\"&lt;p style=&quot;line-height: 170%&quot;&gt;Workplaces are becoming more&lt;br&gt;distributed, and teams are beco-&lt;br&gt;ming increasingly&amp;nbsp;multi-lingual.&lt;br&gt;Diagrams get around the language&lt;br&gt;barriers that are a big drain on&lt;br&gt;productivity.&lt;br&gt;&lt;br&gt;&lt;/p&gt;\" style=\"text;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=15;fontFamily=Verdana;fontColor=#BBBBBB;html=1;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1942\" y=\"1988\" width=\"280\" height=\"210\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"963\" value=\"&lt;font color=&quot;#bbbbbb&quot;&gt;&lt;span style=&quot;font-size: 25px ; line-height: 30px&quot;&gt;AVOID LANGUAGE&lt;/span&gt;&lt;/font&gt;&lt;div&gt;&lt;font color=&quot;#bbbbbb&quot;&gt;&lt;span style=&quot;font-size: 25px ; line-height: 30px&quot;&gt;BARRIERS&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=14;fontFamily=Verdana;fontColor=#444444;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1942\" y=\"1921\" width=\"250\" height=\"60\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"964\" value=\"&lt;font color=&quot;#bbbbbb&quot;&gt;&lt;span style=&quot;font-size: 25px ; line-height: 30px&quot;&gt;TAP INTO OUR IM-&lt;br&gt;PROVED VISUAL IQ&lt;/span&gt;&lt;/font&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=14;fontFamily=Verdana;fontColor=#444444;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1634\" y=\"1921\" width=\"260\" height=\"60\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"965\" value=\"&lt;font color=&quot;#bbbbbb&quot;&gt;&lt;span style=&quot;font-size: 25px ; line-height: 30px&quot;&gt;SUPPORT VISUAL&amp;nbsp;&lt;br&gt;LEARNERS&lt;/span&gt;&lt;/font&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=14;fontFamily=Verdana;fontColor=#444444;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1324\" y=\"1921\" width=\"250\" height=\"60\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"966\" value=\"&lt;font color=&quot;#bbbbbb&quot;&gt;&lt;span style=&quot;font-size: 25px ; line-height: 30px&quot;&gt;HOW CAN WE USE DIAGRAMS&lt;/span&gt;&lt;/font&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=14;fontFamily=Verdana;fontColor=#444444;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1324\" y=\"1624\" width=\"400\" height=\"30\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"967\" value=\"&lt;font style=&quot;font-size: 45px;&quot;&gt;TO IMPROVE PRODUCTIVITY?&lt;/font&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=45;fontFamily=Verdana;fontColor=#BBBBBB;fontStyle=1\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1324\" y=\"1660\" width=\"760\" height=\"30\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"968\" value=\"&lt;font color=&quot;#bbbbbb&quot;&gt;&lt;span style=&quot;font-size: 25px ; line-height: 30px&quot;&gt;PRESENT COMPLEX INFORMATION IN&lt;/span&gt;&lt;/font&gt;&lt;div&gt;&lt;font color=&quot;#bbbbbb&quot;&gt;&lt;span style=&quot;font-size: 25px ; line-height: 30px&quot;&gt;DIAGRAMS&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=14;fontFamily=Verdana;fontColor=#444444;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1635\" y=\"2302\" width=\"490\" height=\"60\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"969\" value=\"&lt;p style=&quot;line-height: 170%&quot;&gt;&lt;br&gt;&lt;/p&gt;\" style=\"text;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=15;fontFamily=Verdana;fontColor=#BBBBBB;html=1;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1635\" y=\"2344\" width=\"20\" height=\"60\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"970\" value=\"&lt;p style=&quot;line-height: 170%&quot;&gt;Employees can understand diagrams more clearly, they can see dependencies&lt;br&gt;and relationships quickly, they have fewer questions, make fewer mistakes,&lt;br&gt;and are therefore more productive.&lt;br&gt;&lt;/p&gt;\" style=\"text;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=15;fontFamily=Verdana;fontColor=#BBBBBB;html=1;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1634\" y=\"2370\" width=\"610\" height=\"110\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"971\" value=\"&lt;span style=&quot;font-size: 25px ; line-height: 30px&quot;&gt;WHAT DO WE NEED TO DO TO SUPPORT&amp;nbsp;&lt;/span&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=14;fontFamily=Verdana;fontColor=#666666;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1324\" y=\"2614\" width=\"540\" height=\"30\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"972\" value=\"&lt;font style=&quot;font-size: 45px&quot;&gt;DIAGRAMMING IN OUR COMPANY?&lt;/font&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=45;fontFamily=Verdana;fontColor=#666666;fontStyle=1\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1324\" y=\"2651\" width=\"810\" height=\"60\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"973\" value=\"&lt;span style=&quot;font-size: 25px ; line-height: 30px&quot;&gt;MAKE DIAGRAMMING AVAILABLE&lt;br&gt;TO EVERYONE&lt;/span&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=14;fontFamily=Verdana;fontColor=#666666;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1324\" y=\"2994\" width=\"440\" height=\"60\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"974\" value=\"&lt;span style=&quot;font-size: 25px ; line-height: 30px&quot;&gt;HAVE ONE CENTRAL PLACE FOR&lt;br&gt;DOCUMENTATION&lt;/span&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=14;fontFamily=Verdana;fontColor=#666666;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1784\" y=\"2996\" width=\"420\" height=\"60\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"975\" value=\"&lt;p style=&quot;line-height: 170%&quot;&gt;To reap the maximum benefit, everyone should be able&lt;br&gt;to create and modify diagrams. Instead of only a few&lt;br&gt;people in an organization using a variety of specialized&lt;br&gt;graphics tools, choose one general tool and enable&lt;br&gt;everyone in the company to use it.&lt;br&gt;&lt;/p&gt;\" style=\"text;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=15;fontFamily=Verdana;fontColor=#666666;html=1;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1324\" y=\"3068\" width=\"440\" height=\"160\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"976\" value=\"&lt;p style=&quot;line-height: 170%&quot;&gt;To cut down on duplication and wasted time, all&lt;br&gt;diagrams used in internal and external communications&lt;br&gt;must be developed and maintained in an intranet with all&lt;br&gt;other documentation, not statically hidden on local&lt;br&gt;computers and emailed around. This also improves&lt;br&gt;visibility and supports collaboration both within and&lt;br&gt;across teams and departments.&lt;br&gt;&lt;/p&gt;\" style=\"text;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=15;fontFamily=Verdana;fontColor=#666666;html=1;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1784\" y=\"3063\" width=\"450\" height=\"210\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"977\" value=\"\" style=\"shape=image;verticalLabelPosition=bottom;labelBackgroundColor=#ffffff;verticalAlign=top;aspect=fixed;imageAspect=0;image=data:image/png,;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1326\" y=\"109\" width=\"262\" height=\"68\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"978\" value=\"\" style=\"shape=image;verticalLabelPosition=bottom;labelBackgroundColor=#ffffff;verticalAlign=top;aspect=fixed;imageAspect=0;image=data:image/svg+xml,;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1880\" y=\"1708\" width=\"277\" height=\"277\" as=\"geometry\"/>\n    </mxCell>\n  </root>\n</mxGraphModel>\n', 'data:image/jpg;base64,', 'general;mockups;signs', 'infographic_3');
