<mxGeometry x=\"874\" y=\"1251\" width=\"74\" height=\"120\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"991\" value=\"&lt;div style=&quot;line-height: 120%&quot;&gt;&lt;font style=&quot;line-height: 120%&quot;&gt;&lt;div&gt;&lt;span style=&quot;line-height: 120%&quot;&gt;Reduce it to purely the essential &lt;/span&gt;&lt;br&gt;&lt;span&gt;information.&lt;/span&gt;&lt;br&gt;&lt;/div&gt;&lt;/font&gt;&lt;/div&gt;\" style=\"text;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=16;fontFamily=Verdana;fontColor=#888888;html=1;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"949\" y=\"459\" width=\"280\" height=\"40\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"992\" value=\"&lt;b&gt;&lt;font style=&quot;font-size: 70px;&quot;&gt;DESIGN RULES&lt;/font&gt;&lt;/b&gt;&lt;br&gt;\" style=\"whiteSpace=wrap;html=1;strokeColor=none;fillColor=none;fontFamily=Verdana;fontSize=70;fontColor=#dddddd;align=left;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"888\" y=\"79\" width=\"700\" height=\"78\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"993\" value=\"&lt;span&gt;for infographics&lt;/span&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=35;fontFamily=Verdana;fontColor=#888888;\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"892\" y=\"163\" width=\"636\" height=\"96\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"994\" value=\"&lt;div style=&quot;line-height: 150%&quot;&gt;IT&#39;S ALL ABOUT&amp;nbsp;&lt;br&gt;&lt;span&gt;VISION-TRACKING&lt;/span&gt;&lt;/div&gt;\" style=\"text;html=1;resizable=0;points=[];autosize=1;align=left;verticalAlign=top;spacingTop=-4;fontSize=24;fontFamily=Verdana;fontColor=#DDDDDD;fontStyle=1\" parent=\"1\" vertex=\"1\">\n      <mxGeometry x=\"1275\" y=\"604\" width=\"240\" height=\"70\" as=\"geometry\"/>\n    </mxCell>\n    <mxCell id=\"995\" value=\"&lt;div&gt;GIVE ME SPACE&lt;/div&gt;\" style=\"text;html=1;resizable=0;